figma.parameters.on(
  "input",
  (
    { parameters, key, query, result }
  ) => {
    const filteredIcons = icons
      .filter((s) => s.name.toLowerCase().includes(query.toLowerCase()))
      .map((icon) => icon);
    result.setSuggestions(filteredIcons);
  }
);

// When the user presses Enter after inputting all parameters, the 'run' event is fired.
figma.on("run", ({ parameters }: RunEvent) => {
  if (parameters) {
    figma
      .importComponentByKeyAsync(parameters["icon-name"])
      .then((component) => {
        const iconInstance = component.createInstance();
        const size = iconInstance.width;
        const selections = figma.currentPage.selection;
        if (selections.length === 1) {
          const selection = selections[0];
          if (selection.type === "FRAME" || selection.type === "COMPONENT") {
            selection.insertChild(0, iconInstance);
            iconInstance.x = selection.width / 2 - size / 2;
            iconInstance.y = selection.height / 2 - size / 2;
          } else {
            const selectionLayerIndex =
              selection.parent.children.indexOf(selection);
            selection.parent.insertChild(selectionLayerIndex + 1, iconInstance);
            iconInstance.x = selection.x;
            iconInstance.y = selection.y;
            if (selection.type === "INSTANCE") selection.remove();
          }
        } else {
          iconInstance.x = figma.viewport.center.x - size / 2;
          iconInstance.y = figma.viewport.center.y - size / 2;
        }
        figma.currentPage.selection = [iconInstance];
        figma.closePlugin();
      });
  }
});
